@test integrate((c*x^n)^(n^-1)*(a+b*(c*x^n)^(n^-1))^-1, x) == :(x*b^-1+-1*a*x*b^-2*(c*x^n)^(-1*n^-1)*log(a+b*(c*x^n)^(n^-1)))
@test integrate((c*x^n)^(n^-1)*(a+b*(c*x^n)^(n^-1))^-2, x) == :(x*b^-2*(c*x^n)^(-1*n^-1)*log(a+b*(c*x^n)^(n^-1))+a*x*b^-2*(c*x^n)^(-1*n^-1)*(a+b*(c*x^n)^(n^-1))^-1)
@test integrate((c*x^n)^(n^-1)*(a+b*(c*x^n)^(n^-1))^-3, x) == :((1/2)*x*a^-1*(c*x^n)^(n^-1)*(a+b*(c*x^n)^(n^-1))^-2)
@test integrate((c*x^n)^(n^-1)*(a+b*(c*x^n)^(n^-1))^-4, x) == :(-1//2*x*b^-2*(c*x^n)^(-1*n^-1)*(a+b*(c*x^n)^(n^-1))^-2+1//3*a*x*b^-2*(c*x^n)^(-1*n^-1)*(a+b*(c*x^n)^(n^-1))^-3)
@test integrate((c*x^n)^(n^-1)*(a+b*(c*x^n)^(n^-1))^-5, x) == :(-1//3*x*b^-2*(c*x^n)^(-1*n^-1)*(a+b*(c*x^n)^(n^-1))^-3+1//4*a*x*b^-2*(c*x^n)^(-1*n^-1)*(a+b*(c*x^n)^(n^-1))^-4)
